/* eslint-disable no-unused-vars */
/* eslint-disable eqeqeq */
import React from "react";

const AddedTeamPlayer = (props) => {
  // console.log(props)
  const member = props.team;
  var totalSalary = 0;
//   var name = '';
//   var role = ''
  for (let i = 0; i < member.length; i++) {
    const total = member[i];
    totalSalary = totalSalary + total.Salary;
    // name = name + total.name;
    // role = role + total.Role
  }
  return (
    <div>
      <h1>My Teams Player</h1>
      <h3>Total Players : {member.length} </h3>
      <h5>Total Salary: $ {totalSalary}</h5>
      <table class="table">
        <thead>
          <tr>
            <th scope="col">Name</th>
            <th scope="col">Role</th>
          </tr>
        </thead>
        <tbody>
            {
                member.map(p=>
                    <tr>
                    <td>{p.name}</td>
                    <td>{p.Role}</td>
                  </tr>
                )
            }

         </tbody>
      </table>
    </div>
  );
};

export default AddedTeamPlayer;
